tables.table_schema:
CREATE TABLE iris_scan_results (
    id SERIAL PRIMARY KEY,
    scan_id INT NOT NULL,
    matching_result FLOAT NOT NULL,
    timestamp TIMESTAMP NOT NULL
);

CREATE TABLE iris_scan_metadata (
    scan_id SERIAL PRIMARY KEY,
    user_id INT NOT NULL,
    scan_quality FLOAT NOT NULL
);

CREATE TABLE iris_scan_results (
    id SERIAL PRIMARY KEY,
    iris_id UUID NOT NULL,
    matching_result FLOAT NOT NULL,
    timestamp TIMESTAMP NOT NULL
);

CREATE TABLE iris_users (
    user_id UUID PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    email VARCHAR(100) NOT NULL,
    registration_date DATE NOT NULL
);

CREATE TABLE iris_devices (
    device_id UUID PRIMARY KEY,
    device_name VARCHAR(50) NOT NULL,
    device_model VARCHAR(50) NOT NULL,
    device_type VARCHAR(20) NOT NULL
);

CREATE TABLE iris_scans (
    scan_id UUID PRIMARY KEY,
    user_id UUID,
    scan_results JSONB
);

CREATE TABLE users (
    user_id UUID PRIMARY KEY,
    username VARCHAR(50) UNIQUE,
    email VARCHAR(100)
);

CREATE TABLE statistics (
    stat_id UUID PRIMARY KEY,
    scan_id UUID,
    analysis_time TIMESTAMP,
    matched_count INT
);

CREATE TABLE logs (
    log_id UUID PRIMARY KEY,
    timestamp TIMESTAMP,
    type VARCHAR(20),
    message TEXT
);
